    return(
        <div>
            <NavigationBar />
           <br/> <h1> Forgot Password </h1> <br/>
            <p> Enter your email below and we will send you a code to reset your password. </p>
            <ForgotPassword />
        </div>

    );
};

export default ForgotPasswordPage;
